var Qs=function(){var query_string={};var query=window.location.search.substring(1);var vars=query.split("&");for(var i=0;i<vars.length;i++){var pair=vars[i].split("=");if(typeof query_string[pair[0]]==="undefined"){query_string[pair[0]]=pair[1];}else if(typeof query_string[pair[0]]==="string"){var arr=[query_string[pair[0]],pair[1]];query_string[pair[0]]=arr;}else{query_string[pair[0]].push(pair[1]);}}
return query_string;}();var Utmza=function(domain){var c=Qs.utm_campaign||null,s=Qs.utm_source||null,m=Qs.utm_medium||null,g=Qs.gclid||null,j=[],expires=new Date(),cookie='__utmza';domain=domain||window.location.hostname;if(window.location.search.indexOf('gclid=')>-1){c='(not set)';s='google';m='cpc';}
if(c)j.push('c='+c);if(s)j.push('s='+s);if(m)j.push('m='+m);if(g)j.push('gclid='+g);if(j.length>0){expires.setTime(expires.getTime()+1000*60*60*24*365);document.cookie=cookie+"="+j.join('|')+"; expires="+expires.toGMTString()+"; domain="+domain+"; path=/";}}();
